import React,{useEffect, useState} from 'react'

function App(){

  const [backedData, setBackendData] = useState([{}])

  useEffect(()=>{
    fetch("/api").then(
      response => response.json()
      ).then(
        data => {
          setBackendData(data)
        }
      )
  },[])



  return(
    <div>

     {(typeof setBackendData.users === 'undefined')?(
      <p>Loading...</p>):
      (backedData.users.map((user,i)=>(
        <p key = {i}>{user}</p>
      )))
     }


    </div>
  )
}

export default App
